def generate_attrs():
    for node in template['nodes']:
        template['node_attrs'][node] = {
            'resources_cpu': 100,
            'resources_cpu_used': 0,
            'resources_mem': 100,
            'resources_mem_used': 0,
            'load_cpu': 0.0,
            'load_mem': 0.0,
            'processing_delay_base': 5,
            'processing_delay': 5,
            'vnf_dict': {},
            'vl_dict': {}
        }
    for edge in template['edges']:
        template['edge_attrs'][edge] = {
            'bandwidth': 100000,
            'bandwidth_used': 0,
            'transmission_delay': 15,
            'vl_dict': {}
        }

def generate_sfc():
    for i in range(1, 601):
        node_in_out = random.sample(template['nodes'], 2)
        vnf = random.sample(vnf_type, 3)
        bandwidth = random.sample([50, 100, 200, 500], 1)[0]
        delay = random.sample([60, 70, 80, 90, 100], 1)[0]
        sfc.append({
            'sfc' + str(i): {
                'node_in': node_in_out[0],
                'node_out': node_in_out[1],
                'vnf_list': vnf,
                'bandwidth': bandwidth,
                'bandwidth_used': 0,
                'delay_limit': delay,
                'delay_actual': 0
            }
        })

def init():
    generate_attrs()
    if len(sfc) == 0:
        generate_sfc()
    return template, vnf_type_template, sfc
